import React, { useEffect, useState } from 'react'
import './HeroSection.css'
import axios from 'axios'
export const HeroSection = () => {

  const [data, setdata] = useState(null)

  useEffect(() => {
    const datafetch = async () => {
      try {
        const response = await axios.get('http://localhost:9093/bike');
        if (response.status===200) {
          setdata(response.data)
        } else {
          console.log('not responding');
        }
      } catch (error) {
        console.log('error in fetchcing data', error);
      }
    }
    datafetch();
  }, [])

 if(data.length===0)return<p>Not Avialable</p>

  return (
    <div className='Herocontainer'>
      <h2>Avialable :</h2>
      <div>
      {data.map((product, index) => (
          <div key={index}>
            <h3>{product.bikeName}</h3>
            <p>{product.bikeNumber}</p>
            <p>{product.bikeModel}</p>
          </div>
        
        ))}
      </div>
    </div>
  )
}
